import React from "react";
import {AppBar, Toolbar, Typography} from "@mui/material"

const Header= ()=>{
    return (
        <AppBar>
            <Toolbar>
                <Typography>
                    BlogsApp
                </Typography>
            </Toolbar>
        </AppBar>
    )
}

export default Header
